package javacollection;

import java.util.ArrayDeque;

public class arrayqeue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ArrayDeque<String> name=new ArrayDeque<>();
		name.push("Nagraj");
		name.push("chukki");
		name.push("abhi");
		System.out.println(name);
		name.pop();
		System.out.println(name);

	}

}
